Write a function to find the majority element in a given integer array using the Boyer-Moore Voting Algorithm.

Example:

Input: [1, 2, 3, 2, 1]
Output: 2
Explanation: 2 is the majority element with 3 votes.

Note:

You may assume that the number of voters does not exceed 10^4.




### Solution


```swift
extension Array where Element == Int {
    func majority(_ threshold: Int) -> Int? {
        guard count >= threshold else { return nil }
        let array = self
        var result: Int? = nil
        var votes: [Int] = []
        for i in 0..<array.count {
            if votes.contains(array[i]) {
                continue
            }
            if votes.count == 0 {
                votes.append(array[i])
                result = array[i]
            } else if votes.contains(result!) {
                votes.append(array[i])
            } else {
                votes.removeAll()
                votes.append(array[i])
                result = array[i]
            }
        }
        return result
    }
}
```

A binary tree is full if all of its vertices have either zero or two children. Let B_n denote the number of full binary trees with n vertices. Implement a function to find B_n.

## Examples

```scala
B_3
// 1
```

## Solution

```scala
object BinaryTree {

  def B_n(n: Int): Int = {
    if (n < 0) throw new IllegalArgumentException
    if (n == 0) return 1
    var ans = 1
    var res = 1
    var i = 0
    while (i < n) {
      if (ans % 2 == 0) {
        res = res * ans
        ans += 1
      } else {
        ans = ans * ans
      }
      i += 1
    }
    res
  }
}
```
